import React from "react";

function Navbar() {
  return (
    <NavbarContainer>
      <NavbarWrap>
        <Logo/>
        <Nav>
          <NavLink></NavLink>
          <Search></Search>
        </Nav>
      </NavbarWrap>
    </NavbarContainer>
  );
}

export default Navbar;
